import{_ as a,c as t,o,ag as s}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"DROP FOREIGN TABLE","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_FOREIGN_TABLE.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_FOREIGN_TABLE.md"}'),i={name:"docs/7x/ref_guide/sql_commands/DROP_FOREIGN_TABLE.md"};function n(r,e,l,d,c,p){return o(),t("div",null,e[0]||(e[0]=[s('<h1 id="drop-foreign-table" tabindex="-1">DROP FOREIGN TABLE <a class="header-anchor" href="#drop-foreign-table" aria-label="Permalink to &quot;DROP FOREIGN TABLE&quot;">​</a></h1><p>Removes a foreign table.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP FOREIGN TABLE [ IF EXISTS ] &lt;name&gt; [, ...] [ CASCADE | RESTRICT ]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP FOREIGN TABLE</code> removes an existing foreign table. Only the owner of a foreign table can remove it.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>IF EXISTS : Do not throw an error if the foreign table does not exist. WarehousePG issues a notice in this case.</p><p>name : The name (optionally schema-qualified) of the foreign table to drop.</p><p>CASCADE : Automatically drop objects that depend on the foreign table (such as views), and in turn all objects that depend on those objects.</p><p>RESTRICT : Refuse to drop the foreign table if any objects depend on it. This is the default.</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>To destroy two foreign tables, <code>films</code> and <code>distributors</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP FOREIGN TABLE films, distributors;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>DROP FOREIGN TABLE</code> conforms to ISO/IEC 9075-9 (SQL/MED), except that the standard only allows one foreign table to be dropped per command. The <code>IF EXISTS</code> clause is a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ALTER_FOREIGN_TABLE.html">ALTER FOREIGN TABLE</a>, <a href="./CREATE_FOREIGN_TABLE.html">CREATE FOREIGN TABLE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',19)]))}const u=a(i,[["render",n]]);export{m as __pageData,u as default};
